import React from "react";

function Resume() {
  return (
    <div class="resume">
      <ul>Front End: HTML CSS JavaScript jQuery Bootstrap React</ul>


      <ul>
      Back End: 
        <li>API's</li>,
        <li>Node</li>,
        <li>Express</li>,
        <li>MySQL, Sequelize</li>,
        <li>MongoDB, Mongoose</li>,
        <li>REST</li>,
        <li>GraphQL</li>,
        </ul>
    </div>
  );
}

export default Resume;
